import React from "react";

export const Carousel = () => {
    const images = [
        "/images/rooms/yellow/yellow.jpg",
        "/images/rooms/blue/blue.jpg",
        "/images/rooms/orange/orange.jpg"
    ];
    return (
        <div className="carousel slide" data-bs-ride="carousel" id="home-tour-images">
            <div className="carousel-indicators">
                {images.map((_, i) => (
                    <li key={i} data-bs-target="#home-tour-images" data-bs-slide-to={i} className={i === 0 ? "active" : ""} aria-current={i === 0 ? "true" : "false"} aria-label={`Slide ${i + 1}`}></li>
                ))}
            </div>
            <div className="carousel-inner" role="listbox">
                {images.map((src, i) => (
                    <div key={i} className={`carousel-item ${i === 0 ? "active" : ""}`}>
                        <img src={process.env.PUBLIC_URL + src} className="w-100 d-block" alt={`Slide ${i + 1}`} />
                    </div>
                ))}
            </div>
            <button className="carousel-control-prev" type="button" data-bs-target="#home-tour-images" data-bs-slide="prev">
                <span className="carousel-control-prev-icon" aria-hidden="true"></span>
                <span className="visually-hidden">Previous</span>
            </button>
            <button className="carousel-control-next" type="button" data-bs-target="#home-tour-images" data-bs-slide="next">
                <span className="carousel-control-next-icon" aria-hidden="true"></span>
                <span className="visually-hidden">Next</span>
            </button>
        </div>
    );
};
